function Nav() {
  return (
    <>
      <nav>
        <ul>
          <li>
            <a to="/">Home</a>
          </li>
          <li>
            <a to="/blogs">Blogs</a>
          </li>
          <li>
            <a to="/contact">Contact</a>
          </li>
        </ul>
      </nav>

    </>
  );
}

export default Nav;
